import React from "react";

function CardForm({formData}) {

    return (
        <div>
            <label htmlFor="front">
                Front
            <br/>
                <textarea id="front" name="back"  value={formData.front}></textarea>
            </label>
            <br/>
            <label htmlFor="back">
                Back
            <br/>
                <textarea id="back" name="back" value={formData.description}></textarea>
            </label>
            <br/>
        </div>
    )
}

export default CardForm;
